  console.log("postsList", postsList);
  return (
    <div>
      <h1>{postsList.length}</h1>
      {postsList > 0 &&
        postsList.map((item) => {
          <p ket={item.id}>hi</p>;
        })}
    </div>
  );
};

export default Posts;
